import './styles.css'
import CVpdf from './Components/CVpdf'
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (

  <Router>
     <Link to="/Components/CVpdf">Preview mode</Link>
    <Navbar />
    <GeneralInfo />
    <Education />
    <Jobs />
    <Routes>
      <Route path="/" element={ <CVpdf />}  />
    </Routes>
  </Router>
  );
}

export default App;
